import { ADD_PERSON } from "../constanst";

const initState = [{ id: "001", name: "tom", age: 18 }];
export default function personReducer(preState = initState, action) {
  const { type, p } = action;
  switch (type) {
    case ADD_PERSON:
      return [p, ...preState];
    default:
      return preState;
  }
}
